import React from "react";
import './Header.css';

const Header = () => {
    return (
        <div>
            <div className="text">
                <h4>calc</h4>
                <h5>THEME</h5>
            </div>
            <div className="input">
                <input id="theme1" type="radio" />
                <label for="theme1">1</label>
                <input id="theme2" type="radio" />
                <label for="theme2">2</label>
                <input id="theme3" type="radio" />
                <label for="theme3">3</label>    
            </div>
        </div>
      
    )
}

export default Header;
